import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import "tailwindcss/tailwind.css";

const Navbar = () => (
  <nav className="bg-gray-900 text-white p-4 flex justify-between items-center">
    <Link to="/" className="text-xl font-bold">UPS Clone</Link>
    <input type="text" placeholder="Search" className="p-2 rounded w-1/4" />
    <div>
      <Link to="/track" className="px-4">Tracking</Link>
      <Link to="/login" className="px-4">Login</Link>
      <Link to="/ship" className="px-4">Shipping</Link>
    </div>
  </nav>
);

const Hero = () => (
  <div className="h-96 bg-cover bg-center flex items-center justify-center text-white text-4xl font-bold" style={{ backgroundImage: "url('https://source.unsplash.com/1600x900/?delivery')" }}>
    Welcome to UPS Clone
  </div>
);

const Features = () => (
  <div className="grid grid-cols-1 md:grid-cols-3 gap-6 p-6 text-center">
    <div className="p-4 bg-gray-100 shadow rounded-lg">Track Your Package</div>
    <div className="p-4 bg-gray-100 shadow rounded-lg">Ship Your Items</div>
    <div className="p-4 bg-gray-100 shadow rounded-lg">Login for More</div>
  </div>
);

const Footer = () => (
  <footer className="bg-gray-900 text-white p-4 text-center">&copy; 2025 UPS Clone</footer>
);

const Home = () => (
  <>
    <Hero />
    <Features />
  </>
);

const App = () => (
  <Router>
    <Navbar />
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/track" element={<div className='p-6 text-center'>Tracking Page</div>} />
      <Route path="/login" element={<div className='p-6 text-center'>Login Page</div>} />
      <Route path="/ship" element={<div className='p-6 text-center'>Shipping Page</div>} />
    </Routes>
    <Footer />
  </Router>
);

export default App;
